import logo from "./logo.svg";
import "./App.css";

function App() {
  const getData = async () => {
    const response = await fetch(`https://api.jikan.moe/v4/anime?q=one piece&limit=20`);
    const result = await response.json();
    console.log(result);
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
